export class Employee {
  firstName: string;
  lastName: string;
  emailId: string;
  id?: number;

  constructor(firstName: string, lastName: string, emailId: string) {
    this.firstName = firstName;
    this.lastName = lastName;
    this.emailId = emailId;
  }
}
